无论函数是内部函数还是外部函数，它都可以修改合约的状态，也可以不修改。当我们声明与智能合约内的存储变量交互的函数时，我们需要通过将其添加为函数的第一个参数来明确声明我们正在访问。这可以通过两种不同的方式完成： 如果我们希望我们的函数能够改变合约的状态，我们可以像这样通过引用传递它 ref self: ContractState。 如果我们希望我们的函数是只读的并且不改变合约的状态，我们可以通过快照传递它，如下所示 self: @ContractState。 只读函数，也称为视图函数，可以直接调用，无需进行事务。您可以通过 RPC 节点直接与它们交互以读取合约的状态，并且它们可以自由调用！另一方面，修改合约状态的外部函数只能通过进行交易来调用。 内部函数不能从外部调用，但对于状态可变性也适用相同的原则。 让我们看一个简单的合约示例，看看它们的实际效果： #[starknet::interface]
trait IExampleContract<TContractState> { fn set(ref self: TContractState, value: u32); fn get(self: @TContractState) -> u32;
} #[starknet::contract]
mod ExampleContract { #[storage] struct Storage { value: u32 } // The `abi(embed_v0)` attribute indicates that all the functions in this implementation can be called externally. // Omitting this attribute would make all the functions in this implementation internal. #[abi(embed_v0)] impl ExampleContract of super::IExampleContract<ContractState> { // The `set` function can be called externally because it is written inside an implementation marked as `#[external]`. // It can modify the contract's state as it is passed as a reference. fn set(ref self: ContractState, value: u32) { self.value.write(value); } // The `get` function can be called externally because it is written inside an implementation marked as `#[external]`. // However, it can't modify the contract's state is passed as a snapshot: it is only a "view" function. fn get(self: @ContractState) -> u32 { // We can call an internal function from any functions within the contract PrivateFunctionsTrait::_read_value(self) } } // The lack of the `external` attribute indicates that all the functions in this implementation can only be called internally. // We name the trait `PrivateFunctionsTrait` to indicate that it is an internal trait allowing us to call internal functions. #[generate_trait] impl PrivateFunctions of PrivateFunctionsTrait { // The `_read_value` function is outside the implementation that is marked as `#[abi(embed_v0)]`, so it's an _internal_ function // and can only be called from within the contract. // It can modify the contract's state as it is passed as a reference. fn _read_value(self: @ContractState) -> u32 { self.value.read() } }
} 在Voyager 上访问合约或在 Remix 中使用它。

