这是一个简单的反合约。 它的工作原理如下： 合约有一个名为“counter”的状态变量，初始化为 0。 当用户调用“increment”时，合约将计数器加 1。 当用户调用“decrement”时，合约会将计数器减 1。 #[starknet::interface]
trait ISimpleCounter<TContractState> { fn get_current_count(self: @TContractState) -> u128; fn increment(ref self: TContractState); fn decrement(ref self: TContractState);
} #[starknet::contract]
mod SimpleCounter { #[storage] struct Storage { // Counter variable counter: u128, } #[constructor] fn constructor(ref self: ContractState, init_value: u128) { // Store initial value self.counter.write(init_value); } #[abi(embed_v0)] impl SimpleCounter of super::ISimpleCounter<ContractState> { fn get_current_count(self: @ContractState) -> u128 { return self.counter.read(); } fn increment(ref self: ContractState) { // Store counter value + 1 let counter = self.counter.read() + 1; self.counter.write(counter); } fn decrement(ref self: ContractState) { // Store counter value - 1 let counter = self.counter.read() - 1; self.counter.write(counter); } }
} 在Voyager 上访问合约或在 Remix 中使用它。

