在 Starknet 上，复数值（例如元组或结构）存储在从存储变量的地址开始的连续段中。复杂存储值的最大大小有 256 个字段元素的限制，这意味着要在存储中存储超过 255 个元素的数组，我们需要将其分成不同大小的段并将这些段存储在多个存储地址中n <= 255。目前开罗没有对存储数组的本机支持，因此您需要为Store要存储的数组类型编写自己的特征实现。 注意：虽然可以将数组存储在存储器中，但并不总是建议这样做，因为读取和写入操作的成本可能会非常高。例如，读取大小的数组n需要n存储读取，写入大小的数组n需要n存储写入。如果一次只需要访问数组的单个元素，建议使用 aLegacyMap并将长度存储在另一个变量中。 以下示例演示了如何编写StorageAccess该Array<felt252>类型的特征的简单实现，使我们能够存储最多包含 255 个felt252元素的数组。 impl StoreFelt252Array of Store<Array<felt252>> { fn read(address_domain: u32, base: StorageBaseAddress) -> SyscallResult<Array<felt252>> { StoreFelt252Array::read_at_offset(address_domain, base, 0) } fn write( address_domain: u32, base: StorageBaseAddress, value: Array<felt252> ) -> SyscallResult<()> { StoreFelt252Array::write_at_offset(address_domain, base, 0, value) } fn read_at_offset( address_domain: u32, base: StorageBaseAddress, mut offset: u8 ) -> SyscallResult<Array<felt252>> { let mut arr: Array<felt252> = ArrayTrait::new(); // Read the stored array's length. If the length is superior to 255, the read will fail. let len: u8 = Store::<u8>::read_at_offset(address_domain, base, offset) .expect('Storage Span too large'); offset += 1; // Sequentially read all stored elements and append them to the array. let exit = len + offset; loop { if offset >= exit { break; } let value = Store::<felt252>::read_at_offset(address_domain, base, offset).unwrap(); arr.append(value); offset += Store::<felt252>::size(); }; // Return the array. Result::Ok(arr) } fn write_at_offset( address_domain: u32, base: StorageBaseAddress, mut offset: u8, mut value: Array<felt252> ) -> SyscallResult<()> { // // Store the length of the array in the first storage slot. let len: u8 = value.len().try_into().expect('Storage - Span too large'); Store::<u8>::write_at_offset(address_domain, base, offset, len); offset += 1; // Store the array elements sequentially loop { match value.pop_front() { Option::Some(element) => { Store::<felt252>::write_at_offset(address_domain, base, offset, element); offset += Store::<felt252>::size(); }, Option::None(_) => { break Result::Ok(()); } }; } } fn size() -> u8 { 255 * Store::<felt252>::size() }
} 然后，您可以在合约中导入此实现，并使用它在存储中存储数组： #[starknet::interface]
