当存储多个值时，我们可以使用一种称为 打包 的技术。打包是一种允许我们将多个值存储在单个毛毡值中的技术。这是通过使用毡值的位来存储多个值来完成的。 例如，如果我们要存储两个u8值，我们可以使用毛毡值的前 8 位存储第一个u8值，后 8 位存储第二个u8值。这样，我们可以将两个u8值存储在一个感觉值中。 Cairo 提供了一个使用包装的内置商店，您可以将其与该StorePacking特征一起使用。 trait StorePacking<T, PackedT> { fn pack(value: T) -> PackedT; fn unpack(value: PackedT) -> T;
} 这允许这允许T通过首先使用函数将其打包到类型中来PackedT存储类型pack，然后将PackedT值与其Store实现一起存储。读取值时，我们首先检索该PackedT值，然后T使用unpack函数将其解压到类型中。 这是使用特征存储Time具有两个值的结构的示例：u8 StorePacking #[starknet::interface]
